    [TestFixture]
    public class Solution
    {
        // Use Partition code from QuickSort challenges to find the median in array of integers
        // NOTE: This code does not pass the final test case on HackerRack, Test Case #3, which times out :(
        public static int FindTheMedian(int[] arr, int lowIndex, int highIndex)
        {
            var median = arr.Length / 2;
            var pivotIndex = Partition(arr, 0, arr.Length - 1);
            int partitionCounter = 0;

            while (pivotIndex != median)
            {
                if (pivotIndex < median)
                {
                    pivotIndex = Partition(arr, pivotIndex + 1, arr.Length - 1);
                    partitionCounter++;
                }
                else
                {
                    pivotIndex = Partition(arr, 0, pivotIndex - 1);
                    partitionCounter++;
                }
            }

            return arr[pivotIndex];
        }
        public static int Partition(int[] arr, int lowIndex, int highIndex)
        {
            int pivotItem = arr[highIndex];
            int smallIndex = lowIndex - 1;

            for (int i = lowIndex; i < highIndex; i++)
            {
                if (arr[i] <= pivotItem)
                {
                    smallIndex++;
                    Swap(arr, i, smallIndex);
                }
            }

            Swap(arr, highIndex, smallIndex + 1);
            return smallIndex + 1;
        }
        private static void Swap(int[] arr, int k, int small)
        {
            int temp;
            temp = arr[k];
            arr[k] = arr[small];
            arr[small] = temp;
        }


